#![expect(clippy::unwrap_used)]

use super::*;
use aidoku_test::aidoku_test;

#[aidoku_test]
fn chapter_default_first() {
	assert_eq!(
		*CHAPTERS
			.iter()
			.rfind(|chapter| chapter.scanlators.as_deref().unwrap().first().unwrap() == "默認")
			.unwrap(),
		Chapter {
			key: "7a8aee6a-523c-11e9-bc73-00163e0ca5bd".into(),
			title: None,
			chapter_number: Some(1.0),
			volume_number: None,
			date_uploaded: Some(1_553_875_531),
			scanlators: Some(["默認".into()].into()),
			url: Some("https://www.2025copy.com/comic/jiandieguojiajia/chapter/7a8aee6a-523c-11e9-bc73-00163e0ca5bd".into()),
			..Default::default()
		}
	);
}

